I luoghi semplici ma in qualche modo decadenti e maestosi allo stesso tempo. Sono quelli che più adoro, soprattutto se intrisi di coccoli, stracchino e aria di famiglia. Conoscenze vecchie, quelle che fanno tanto focolare e faccine così nuove da non avere nemmeno un neo ma degli occhi grandissimi come carte assorbenti sul mondo.
Voglio che certi sabato mi rimangano così nella memoria. 
